Дагестанский камень – сравнительно новый материал на строительном рынке, быстро завоевавший популярность благодаря высоким потребительским характеристикам.
Его название – собирательный «образ» осадочных пород, которые накапливались в природе тысячелетиями: ракушечник, известняк, песчаник. Натуральность и разнообразие фактур дагестанского камня поставили его в один ряд с самыми востребованными современными материалами: керамогранитом, сайдингом, клинкерной плиткой.
В сравнении с этими видами отделки фасад из дагестанского камня приобретает благородство и завершенность композиции – широкий выбор расцветок, текстур и возможность практически любой обработки позволяет реализовывать самые экзотические фантазии. 
